import React from 'react';
import { Modal, Box, Typography, Grid, TextField, Button, FormControl, InputLabel, Select, MenuItem } from '@mui/material';

const ModalForm = ({ open, handleClose, formData, handleChange, handleSubmit }) => {
  const handlePartyChange = (e) => {
    const { name, value } = e.target;

    // If the selected field is "party"
    if (name === "party") {
      // If the value is not empty, set casted to "Yes" and disable it
      const castedValue = value ? true : formData.casted;
      handleChange({ target: { name: "casted", value: castedValue } });
    } else {
      // For other fields, call the usual handleChange function
      handleChange(e);
    }
  };

  return (
    <Modal
      open={open}
      onClose={handleClose}
      aria-labelledby="modal-modal-title"
      aria-describedby="modal-modal-description"
    >
      <Box sx={{
        position: 'absolute',
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)',
        width: 500,
        bgcolor: 'background.paper',
        boxShadow: 24,
        p: 4,
        borderRadius: 8,
      }}>
        <Typography id="modal-modal-title" variant="h6" component="h2" mb={2}>
          Edit Voter
        </Typography>
        <Grid container spacing={2}>
          <Grid item xs={12} sm={6}>
            <TextField
              name="voter_name"
              label="Name"
              value={formData.voter_name}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              name="age"
              label="Age"
              type="number"
              value={formData.age}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              name="sex"
              label="Sex"
              value={formData.sex}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              name="state"
              label="State"
              value={formData.state}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              name="constituency"
              label="Constituency"
              value={formData.constituency}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <FormControl fullWidth>
              <InputLabel id="party-label">Party</InputLabel>
              <Select
                labelId="party-label"
                name="party"
                id="party"
                label="Party"
                value={formData.party}
                onChange={handlePartyChange} // Using the modified handleChange function
                fullWidth
              >
                <MenuItem value="TDP">TDP</MenuItem>
                <MenuItem value="YSRCP">YSRCP</MenuItem>
                <MenuItem value="BJP">BJP</MenuItem>
                <MenuItem value="NOTA">NOTA</MenuItem>
              </Select>
            </FormControl>
          </Grid>
          <Grid item xs={12} sm={6} sx={{ marginBottom: '10px' }}>
            <FormControl fullWidth>
              <InputLabel id="casted-label">Casted</InputLabel>
              <Select
                labelId="casted-label"
                id="casted"
                name="casted"
                value={formData.casted}
                label="Casted"
                onChange={handleChange}
                disabled={!!formData.party} // Disable if party is selected
              >
                <MenuItem value={true}>Yes</MenuItem>
                <MenuItem value={false}>No</MenuItem>
              </Select>
            </FormControl>
          </Grid>
        </Grid>
        <Grid container sx={{ justifyContent: 'end' }}>
          <Button
            variant="contained"
            onClick={handleSubmit}
            sx={{
              backgroundColor: '#EE8832',
              color: 'white',
              fontSize: '16px',
              textTransform: 'none',
              fontWeight: 'bold',
              '&:hover': {
                backgroundColor: '#EE8832',
                color: 'white'
              }
            }}
          >
            Save
          </Button>
        </Grid>
      </Box>
    </Modal>
  );
};

export default ModalForm;
